Teenage Mutant Ninja Turtles 01-36 + Ann (2011- |Digital|Empire+TheGroup)

This modern relaunch of the TMNT franchise has been a rousing success with both fans and critics alike; smart, with great characterizations of these classic characters that stay true to the original visions while adding new layers and especially some much-welcome emotional punch. Consider the journeys taken by Raphael and Leonardo in these pages in some long arcs and storylines and you will see that this is a series that means business. Terrific writing with gorgeous art and tons of nice action - along with the wonderful modern villians introduced like Old Hob and Alopex as well as of course the ruthless Shredder in full glory - all combine to make this a can't miss series.

This torrent contains all 36 issues of the series so far, in digital copies thanks to TheGroup and Empire scanners. The 2012 Annual is also included. Please seed, and enjoy. 

